    return (
        <div>
            <div>
                <FiHome className="text-3xl" />
                
                <h3>Home</h3>
            </div>
          
            <h3>Library</h3>
            <h3>Liked</h3>
            <h3>Watch Later</h3>
            <h3>History</h3>
        </div>
    )
}
